package com.example.auta.domain.entities;import com.example.auta.models.enums.ReservationStatus;import lombok.*;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.math.BigDecimal;import java.time.LocalDate;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class ReservationEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    private LocalDate reservationDate;    @ManyToOne(cascade = CascadeType.PERSIST)    @JoinColumn(name ="customer_id")    @EqualsAndHashCode.Exclude @ToString.Exclude    private CustomerEntity customer;    @OneToOne    private CarEntity car;    private LocalDate rentalStartDate;    private LocalDate rentalEndDate;    @ManyToOne    private BranchEntity rentalBranch;    @ManyToOne    private BranchEntity returnBranch;    private BigDecimal totalPrice;    private ReservationStatus reservationStatus;}